数据回调




CameraInfoBean
| 名称                     | 描述   | 
| ------------------------ | ------ | 
| password                   | 秘钥   |
| p2pId               | p2p Id | 
| p2pSpecifiedType         | p2p的类型   | 
| P2pConfig             | p2p配置信息 | 

P2pConfig
| 名称                     | 描述   | 
