存储卡及本地录像管理
描述
在开始管理存储卡或者进行录像回放前，需要先获取存储卡的状态，如果设备未检测到存储卡，则无法进行下一步。如果存储卡异常，则需要先格式化存储卡。

sdcard的LAN/Cloud数据下发是不需要传其他参数的。

状态
DpSDStatus是控制sdcard状态的DP点。
示例代码
mTuyaCameraDevice.registorTuyaCameraDeviceControlCallback(DpSDStatus.ID, new ITuyaCameraDeviceControlCallback() {
                    @Override
